import React from "react";
import {useEffect, useState} from "react";

class List extends React.Component{
    constructor(props) {
        super(props);
        this.state = {apiResponse:""}
    }
    callAPI(){
        fetch("http://localhost:8080/testAPI")
            .then(res =>res.text())
            .then(res => this.setState({apiResponse : res}))
    }
    componentWillMount() {
        this.callAPI()
    }
}



export default List;
